import Footer from './components/section/footer';
import News from './components/section/newsletter';
import Last from './components/section/last';

function App() {
  return (
    <>
    <Banner></Banner>
    <Nav></Nav>
    <First></First>
    <Hero3></Hero3>
    <Last></Last>
    <News></News>
    <Footer></Footer>
    </>
  );
}

export default App;
